import React, { useState } from "react";
import LandingPage from "./Landing";
import Dashboard from "./Dashboard";

const App = () => {
  const [started, setStarted] = useState(false);

  return (
    <div>
      {started ? <Dashboard /> : <LandingPage onStart={() => setStarted(true)} />}
    </div>
  );
};

export default App;
